import './App.css';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import Login from './components/Pages/Login/Login'
import Navbar from './components/Navbar/Navbar'
import Home from './components/Pages/Home/Home'
import LoggedIn from './components/Pages/Logged In/LoggedIn'
import RecordShift from './components/Pages/RecordShift/RecordShift'
import NewUser from './components/Users/NewUser'
import { useState } from 'react';
import useToken from './components/Security/token'

function App() {
  const { token, setToken } = useToken();
  const [tokenValidation, setTokenValidation] = useState(false);


  if(token == null || !token.verify){
    console.log("No existe token");
    return(
      <div>
        <h1>Welcome!</h1>
        <Router>
          <Routes>
            <Route path="/*" element={<Login setToken={setToken} setTokenValidation={setTokenValidation}/>}/>
          </Routes>
        </Router>
      </div> 
    )
  }else {
    console.log(token)
    return (
      <div>
        <Router>  
          <Navbar/>
           <Routes>
              <Route path="/*" element={<Home/>}/>
              <Route path="/LoggedIn" element={<LoggedIn/>}/>
              <Route path="/recordshift" element={<RecordShift/>}/>
              <Route path="/SignUp" element={<NewUser/>}/>
           </Routes>
        </Router>
      </div>
    );
  }
}

export default App;
